import React from "react";
import {NavLink} from "react-router-dom";
// import {GiShoppingBag} from 'react-icons/gi'

// import { useAuth } from "../../context/auth";
// import toast from "react-hot-toast";
// import SearchInput from "../Form/SearchInput";
// import useCategory from "../../hooks/useCategory";
// import { useCart } from "../../context/cart";
// import { Badge } from "antd";

const Header = () => {
  <>
  <h1>SACHIN</h1>
 <nav className="navbar navbar-expand-lg navbar-light bg-light">
  <NavLink to="/" className="navbar-brand" href="#">Navbar</NavLink>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon" />
  </button>
  <div className="collapse navbar-collapse" id="navbarSupportedContent">
    <ul className="navbar-nav mr-auto">
      <li className="nav-item active">
        <NavLink to="/" className="nav-link" href="#">Home <span className="sr-only">(current)</span></NavLink>
      </li>
      <li className="nav-item">
        <NavLink to="/" className="nav-link" href="#">Link</NavLink>
      </li>
      <li className="nav-item dropdown">
        <NavLink to="/" className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
          Dropdown
        </NavLink>
        <div className="dropdown-menu" aria-labelledby="navbarDropdown">
          <NavLink to="/" className="dropdown-item" href="#">Action</NavLink>
          <NavLink to="/" className="dropdown-item" href="#">Another action</NavLink>
          <div className="dropdown-divider" />
          <NavLink to="/" className="dropdown-item" href="#">Something else here</NavLink>
        </div>
      </li>
      <li className="nav-item">
        <NavLink to="/" className="nav-link disabled" href="#">Disabled</NavLink>
      </li>
    </ul>
   
  </div>
</nav>

  </>
    
};

export default Header;
